import React from 'react';
import '../css/IndProject.css';




class IndProject extends React.Component {
    render () {
        console.log(this.props.project.image)
        return (<div className="ind-project">
                <div className="ind-sub-div">
                    <div className="col-6">
                        <img src={this.props.project.image} alt={this.props.project.title}></img>
                    </div>
                    <div className="col-6">

                    </div>
                </div>

                <hr className="col-11"></hr>
            </div>
        );
    }
}

export default IndProject;
